        timeShow(timestamp) { // 毫秒时间戳
          let time = Math.floor((new Date().getTime()-timestamp)/1000);

          if(time < 0) {
            let date = new Date(timestamp);
            return date.getFullYear()+"/"+(date.getMonth()+1)+"/"+date.getDate();
          } else if(time == 0) {
            return this.lang('justNow');
          } else if(time < 60) {
            return time+this.lang('secondAgo');
          } else if(time < 3600) {
            return Math.floor(time/60)+this.lang('minuteAgo');
          } else if(time < 86400) {
            return Math.floor(time/3600)+this.lang('hourAgo');
          } else {
            let date = new Date(timestamp);
            return date.getFullYear()+"/"+(date.getMonth()+1)+"/"+date.getDate();
          }
        },
        getUrlParam(name) {
          var reg = new RegExp("(^|&)" + name + "=([^&]*)(&|$)"); // 构造一个含有目标参数的正则表达式对象
          var r = window.location.search.substr(1).match(reg); // 匹配目标参数
          if (r != null) return decodeURI(r[2]);
          return null; // 返回参数值
        },
        highlight(content, keywords, leftTag, rightTag) {
          if(keywords == '') {
            return content.escape();
          }

          // 预处理字符，防 xss 攻击
          // content = content.escape();
          // keywords = keywords.escape().split(/\s+/);

          keywords = keywords.split(/\s+/);

          console.log('content', content.toUpperCase(), content.length);
          console.log('keywords', keywords, keywords.length);

          // 查找所有位置
          let pos = [];
          let str = content.toUpperCase();
          for(let keyword of keywords) {
            keyword = keyword.toUpperCase();
            if(keyword == '') continue;

            let index = 0;
            do {
              index = str.indexOf(keyword, index);
              if(index == -1) break;
              pos.push([index, index+keyword.length-1]);
              index = index+keyword.length;
            }while(index != -1);
          }

          console.log('pos', JSON.parse(JSON.stringify(pos)));
          // 无任何匹配
          if(pos.length <= 0) {
            return content.escape();
          }

          // 合并重复区间
          if(pos.length > 1) {
            // alert('s')
            pos = pos.sort(function(a, b){return a[0] - b[0]});
            console.log('sort', JSON.parse(JSON.stringify(pos)));
            let merge = [];
            for(let i = 0, k = 0; i < pos.length; i++) {
              if(i == 0 || merge[k-1][1] < pos[i][0]) {
                merge.push(pos[i]);
                k++;
                console.log('1')
              } else {
                merge[k-1][1] = Math.max(merge[k-1][1], pos[i][1]);
                console.log('2')
              }
              console.log('a', JSON.parse(JSON.stringify(merge)), JSON.parse(JSON.stringify(pos[i])))
            }
            pos = merge;
            console.log('merge', pos)
          }

          // 字符替换（高亮）
          let res = '';
          for(let i in pos) {
            if(i == 0) {
              res += content.substring(0, pos[i][0]).escape()
                  + leftTag+content.substring(pos[i][0], pos[i][1]+1).escape()+rightTag;
            } else {
              res += content.substring(pos[i-1][1]+1, pos[i][0]).escape()
                  + leftTag+content.substring(pos[i][0], pos[i][1]+1).escape()+rightTag;
            }
          }
          res += content.substring(pos[pos.length-1][1]+1, content.length).escape();

          return res;
        },
        getKeyType(event) {
          if(this._device.platform == 'Mac') {
            if(event.ctrlKey == true) {
              return 'ctrl';
            } else if(event.metaKey == true) {
              return 'meta/ctrl';
            } else if(event.shiftKey == true) {
              return 'shift';
            } else if(event.altKey == true) {
              return 'alt';
            }
          } else {
            if(event.metaKey == true) {
              return 'meta';
            } else if(event.ctrlKey == true) {
              return 'meta/ctrl'
            } else if(event.shiftKey == true) {
              return 'shift';
            } else if(event.altKey == true) {
              return 'alt';
            }
          }
          return '';
        },
